import React, { Component } from 'react';
import searchButton from '../../../images/search-button.svg';
import logo from '../../../images/sajarilogo.svg';
class Sort extends Component {
    render() {
        return (
            <div className="row">
                <img src={searchButton} alt="searchButton" style={{height: 40, width: 40}}/>
                <div className="col-sm-9">
                <input type="text" className="no-border" placeholder="Search..." style={{ position: 'absolute'}}/> 
                    <div className="text-right">
                            Powered by <b>Sajari.com</b>
                        <img src={logo} alt="logo" />
                    </div>
                <hr/>
                </div>
                <div className="col-sm-2">
                    <select className="form-control filter">
                        <option>Best Match</option>
                    </select>
                </div>
            </div>
        );
    }
}

export default Sort;
